        server.sendCommand(`box  ${player.oldPlayerPos[0]} ${player.oldPlayerPos[1]} ${player.oldPlayerPos[2]} ${player.playerPos[0]} ${player.playerPos[1]} ${player.playerPos[2]} 3 ${hud.currentColor.r} ${hud.currentColor.g} ${hud.currentColor.b}`);
